        <script>
            var accessKey = "";
            var loggedIn = false;
            async function auth() {

                if (localStorage.getItem("accessJwt") === null) {
                
                    accessKey = window.prompt("Some features (like follow-all) require user authentication to function.\nPlease enter in an account access token OR leave blank to authenticate through Blue.");
                } else {

                    accessKey = localStorage.getItem("accessJwt");
                }

                if (accessKey === null) {

                    return;
                } else if (accessKey === "") {

                    window.open("https://blue.amazingca.dev/login?auth=tooling");
                } else {

                    const req = {
                        method: "GET",
                        headers: {
                            "Authorization": "Bearer " + accessKey
                        }
                    }

                    try {

                        const res = JSON.parse(await fetch("https://bsky.social/xrpc/com.atproto.server.getSession", req).then(r => r.text()));

                        if (res.error === undefined) {

                            localStorage.setItem("accessJwt", accessKey);
                            loggedIn = true;

                            document.getElementById("loginB").classList.add("hidden");

                            document.getElementById("logoutB").innerHTML = "Logout @" + res.handle;
                            document.getElementById("logoutB").classList.remove("hidden");
                        } else {

                            localStorage.removeItem("accessJwt");
                            window.alert("The sesssion token could not be verified! Try refreshing it!");
                        }
                    } catch(e) {

                        console.log(e);
                    }
                }
            }

            function authenticated() {

                const req = {
                    method: "GET",
                    headers: {
                        "Authorization": "Bearer " + accessKey
                    }
                }

                try {

                    const res = JSON.parse(await fetch("https://bsky.social/xrpc/com.atproto.server.getSession", req).then(r => r.text()));

                    if (res.error === undefined) {

                        localStorage.setItem("accessJwt", accessKey);
                        loggedIn = true;

                        document.getElementById("loginB").classList.add("hidden");

                        document.getElementById("logoutB").innerHTML = "Logout @" + res.handle;
                        document.getElementById("logoutB").classList.remove("hidden");
                    } else {

                        localStorage.removeItem("accessJwt");
                        window.alert("The sesssion token could not be verified! Try refreshing it!");
                    }
                } catch(e) {

                    console.log(e);
                }
            }

            var toConfirm = "";

            function logout() {

                loggedIn = false;
                localStorage.removeItem("userDid");
                localStorage.removeItem("refreshJwt");
                localStorage.removeItem("accessJwt");

                document.getElementById("loginB").classList.remove("hidden");
                document.getElementById("logoutB").classList.add("hidden");

                if (toConfirm != "") {

                    toConfirm = "";

                    document.getElementById("confirmB").innerHTML = "";
                    document.getElementById("confirmM").classList.add("hidden");
                }
            }

            function toConfirmFollowAll() {

                if ((localStorage.getItem("accessJwt") === null) || (loggedIn === false)) {

                    window.alert("Must be authenticated! Try importing your account details first then run this function again!");
                } else {

                    toConfirm = "followAll";

                    document.getElementById("confirmB").innerHTML = "Confirm: Follow All";
                    document.getElementById("confirmM").classList.remove("hidden");
                }
            }

            async function followAll() {

                document.getElementById("progStatus").innerHTML = "Progress: Grabbing followed users...";
                document.getElementById("progPercent").innerHTML = "0%";

                var unfollowedDids = [];

                var temp = "";
                var temptemp = "";
                    
                var going = true;
                var lastitem;

                while(going) {
                        
                    if (temptemp === "") {
                            
                        var t;
                        try {
                            t = await fetch(`https://bsky.social/xrpc/com.atproto.repo.listRecords?repo=amazingca.dev&collection=app.bsky.graph.follow&limit=100`).then(r => r.text());
                        } catch (e) {
                            console.log(e);
                        }

                        //console.log(JSON.parse(t).records.length);
                        if (JSON.parse(t).records.length < 100) {
                            //console.log("first is last");
                            temp = JSON.stringify(JSON.parse(t).records);
                            going = false;
                        } else {
                            //console.log("first not last");
                            var tid = JSON.parse(t).records[JSON.parse(t).records.length - 1].uri.split("/")[4]
                            lastitem = tid;
                            temptemp = JSON.stringify(JSON.parse(t).records).replaceAll("]", "");
                        }
                    } else {

                        var t;
                        try {
                            t = await fetch(`https://bsky.social/xrpc/com.atproto.repo.listRecords?repo=amazingca.dev&collection=app.bsky.graph.follow&limit=100&rkeyEnd=${lastitem}`).then(r => r.text());
                        } catch (e) {
                            console.log(e);
                        }

                        //console.log(JSON.parse(t).records.length);
                        if (t.includes("[]")) {
                            temp = temptemp + "]";
                            going = false;
                        } else if (JSON.parse(t).records.length < 100) {
                            //console.log("not first is last");
                            temp = temptemp + "," + JSON.stringify(JSON.parse(t).records).replaceAll("[", "");
                            going = false;
                        } else {
                            //console.log("not first is not last");
                            var tid = JSON.parse(t).records[JSON.parse(t).records.length - 1].uri.split("/")[4]
                            lastitem = tid;
                            temptemp = temptemp + "," + JSON.stringify(JSON.parse(t).records).replaceAll("[", "").replaceAll("]", "");
                        }
                    }
                }

                const following = JSON.parse(temp);
                var isFollowing = [];
                for (var follow of following) {

                    isFollowing.push(follow.value.subject);
                }

                //console.log("Is following " + isFollowing.length + " users.");
                document.getElementById("progStatus").innerHTML = "Progress: Following " + isFollowing.length + " users";

                for (var u = 0; u < dids.length; u++) {

                    var exists = false;

                    for (var o = 0; o < isFollowing.length; o++) {

                        if (dids[u] === isFollowing[o]) {

                            exists = true;
                        }
                    }

                    if (exists === false) {

                        unfollowedDids.push(dids[u]);
                    }
                }

                //console.log("Completed sorter: " + unfollowedDids.length + " users not followed. Attempting to follow these users...");
                document.getElementById("progStatus").innerHTML = "Progress: Attempting to follow " + unfollowedDids.length + " users";

                for (var i = 0; i < unfollowedDids.length; i++) {

                    const creationDate = new Date().toISOString();
                    const recordData = {
                        method: "POST",
                        body: JSON.stringify({
                            "repo": "did:plc:4usvqnzxonnvz2hyvx2msr4h",
                            "collection": "app.bsky.graph.follow",
                            "record": {
                                "subject": unfollowedDids[i],
                                "createdAt": creationDate
                            }
                        }),
                        headers: {
                            "Authorization": "Bearer " + localStorage.getItem("accessJwt"),
                            "Content-Type": "application/json"
                        }
                    }

                    try {

                        const req = await fetch("https://bsky.social/xrpc/com.atproto.repo.createRecord", recordData).then(r => r.status);

                        if (req === 200) {

                            //console.log(`${Math.round(100*(`${i/unfollowedDids.length}`.split("").slice(0, 6).join("")*100))/100}` + "% done.");
                            document.getElementById("progPercent").innerHTML = Math.round(100*(`${i/unfollowedDids.length}`.split("").slice(0, 6).join("")*100))/100 + "%";
                            document.getElementById("progressB").value = Math.round(100*(`${i/dids.length}`.split("").slice(0, 6).join("")*100))/10000;
                        }
                    } catch (e) {

                        console.log(e);
                        continue;
                    }
                }

                document.getElementById("cancelM").classList.add("hidden");

                document.getElementById("progPercent").innerHTML = "100%";
                document.getElementById("progressB").value = "1";

                if (unfollowedDids.length === 0) {

                    document.getElementById("progStatus").innerHTML = "Progress: NO USERS TO FOLLOW";
                } else {

                    document.getElementById("progStatus").innerHTML = "Progress: COMPLETED";
                }
            }

                    posts = posts + temp + "<br><br>";

                    document.getElementById("progStatus").innerHTML = "Progress: " + i + " users done";
                    document.getElementById("progPercent").innerHTML = Math.round(100*(`${i/dids.length}`.split("").slice(0, 6).join("")*100))/100 + "%";
                    document.getElementById("progressB").value = Math.round(100*(`${i/dids.length}`.split("").slice(0, 6).join("")*100))/10000;
                }

                document.getElementById("data").innerHTML = posts;

                document.getElementById("progStatus").innerHTML = "Progress: COMPLETED";
                document.getElementById("progPercent").innerHTML = "100%";
                document.getElementById("progressB").value = "1";

                document.getElementById("getPostsB").style.backgroundColor = "";
                document.getElementById("getPostsB").style.color = "#000";
            }

            async function getFollowers(passed) {

                document.getElementById("getFollowersB").style.backgroundColor = "#04aa6d";
                document.getElementById("getFollowersB").style.color = "#fff";

                var count = 0;

                for (var i = 0; i < passed.length; i++) {

                    var temp = "";
                    var temptemp = "";
                    
                    var going = true;
                    var lastitem;

                    while(going) {
                        
                        if (temptemp === "") {
                            
                            var t;
                            try {
                                t = await fetch(`https://bsky.social/xrpc/com.atproto.repo.listRecords?repo=${passed[i]}&collection=app.bsky.graph.follow&limit=100`).then(r => r.text());
                            } catch (e) {
                                console.log(e);
                            }

                            //console.log(JSON.parse(t).records.length);
                            if (JSON.parse(t).records.length < 100) {
                                //console.log("first is last");
                                temp = JSON.stringify(JSON.parse(t).records);
                                going = false;
                            } else {
                                //console.log("first not last");
                                var tid = JSON.parse(t).records[JSON.parse(t).records.length - 1].uri.split("/")[4]
                                lastitem = tid;
                                temptemp = JSON.stringify(JSON.parse(t).records).replaceAll("]", "");
                            }
                        } else {

                            var t;
                            try {
                                t = await fetch(`https://bsky.social/xrpc/com.atproto.repo.listRecords?repo=${passed[i]}&collection=app.bsky.graph.follow&limit=100&rkeyEnd=${lastitem}`).then(r => r.text());
                            } catch (e) {
                                console.log(e);
                            }

                            //console.log(JSON.parse(t).records.length);
                            if (t.includes("[]")) {
                                temp = temptemp + "]";
                                going = false;
                            } else if (JSON.parse(t).records.length < 100) {
                                //console.log("not first is last");
                                temp = temptemp + "," + JSON.stringify(JSON.parse(t).records).replaceAll("[", "");
                                going = false;
                            } else {
                                //console.log("not first is not last");
                                var tid = JSON.parse(t).records[JSON.parse(t).records.length - 1].uri.split("/")[4]
                                lastitem = tid;
                                temptemp = temptemp + "," + JSON.stringify(JSON.parse(t).records).replaceAll("[", "").replaceAll("]", "");
                            }
                        }
                    }
                    
                    var tempParsed = JSON.parse(temp);

                    count += tempParsed.length;
                    //console.log(`${Math.round(100*(`${i/passed.length}`.split("").slice(0, 6).join("")*100))/100}` + "% done: " + tempParsed.length + " following");
                    document.getElementById("progStatus").innerHTML = "Progress: Batch - " + tempParsed.length + "; Follows - " + count + ";";
                    document.getElementById("progPercent").innerHTML = Math.round(100*(`${i/passed.length}`.split("").slice(0, 6).join("")*100))/100 + "%";
                    document.getElementById("progressB").value = Math.round(100*(`${i/passed.length}`.split("").slice(0, 6).join("")*100))/10000;

                    for (var o = 0; o < tempParsed.length; o++) {

                        var inside = false;
                            
                        for (var y = 0; y < followers.length; y++) {

                            if ((followers[y] === tempParsed[o].value.subject)) {

                                inside = true;
                            }
                        }

                        if ((inside === false) && (tempParsed[o].value.subject != "") && (tempParsed[o].value.subject.includes("did:plc"))) {
                            
                            followers[followers.length] = tempParsed[o].value.subject;
                            
                            //console.log(followers[followers.length-1]);
                        }
                    }
                }

                //console.log(followers);
                //console.log("*All* users on the platform are following others a total of " + count + " times!");
                //document.getElementById("data").innerHTML = document.getElementById("data").innerHTML + JSON.stringify(followers) + `<br><button onclick='getFollowers(${JSON.stringify(followers)})'>Another Round</button><br><br>`;

                dids = followers;

                document.getElementById("progStatus").innerHTML = "Progress: " + followers.length + " users, " + count + " follows";
                document.getElementById("progPercent").innerHTML = "100%";
                document.getElementById("progressB").value = "1";

                document.getElementById("data").innerHTML = JSON.stringify(followers);
                document.getElementById("dataP").classList.remove("hidden");

                document.getElementById("getFollowersB").style.backgroundColor = "";
                document.getElementById("getFollowersB").style.color = "#000";
            }
